def save_to_db(klinesdata):
    for market,recs in klinesdata.items():
        for rec in recs:
            k = Kline()
            date = datetime.datetime.fromtimestamp(rec[0])
            date_utc = attach_utc_to_naive_datetime(date)
            mods=Kline.objects.filter(datetime=date_utc)
            mods=mods.filter(market=market)
            if mods.exists():
                print(market,rec[0],'already inside')
                continue
            else:
                print(market,rec[0],'updating')
                k.datetime = date_utc
                k.timestamp = rec[0]
                k.close = rec[4]
                k.high = rec[2]
                k.low = rec[3]
                k.market = market
                k.open = rec[1]
                k.volume = rec[5]
                k.save()




def attach_utc_to_naive_datetime(dt):
    from django.utils.timezone import utc
    assert dt.tzinfo is None
    dt = dt.replace(tzinfo=utc)
    return dt



def get_all_data_from_db():
    query=Kline.objects.all()
    return query

def query_from_db_since(time_in_hours):
    time_ago = datetime.datetime.now() - datetime.timedelta(hours=time_in_hours)
    time_ago = attach_utc_to_naive_datetime(time_ago)
    k = Kline.objects.filter(datetime__gte=time_ago)
    return k

def latest_timestamp():
    obj = Kline.objects.filter().latest('timestamp')
    timestamp = obj.timestamp
    return timestamp

def current_datetime_as_timestamp():
    date = datetime.datetime.now()
    seconds = int(date.timestamp())
    return seconds


def datetime_difference():
    dif=current_datetime_as_timestamp()-Kline.objects.all().aggregate(Max('timestamp')).popitem()[1]
    dif_minutes=dif/60
    return int(dif_minutes)


def get_means_from_db(market):
    hours = [2, 6, 12, 24, 72, 168]
    meanlist = []
    dct={}
    for n in hours:
        datetime_from = datetime.datetime.now() - datetime.timedelta(hours=n)
        datetime_from = attach_utc_to_naive_datetime(datetime_from)
        mean = Kline.objects.filter(datetime__gte=datetime_from,
                                         market=market,
                                         ).aggregate(Avg('open'))
        meanlist.append(mean['open__avg'])

    return meanlist


